import React from 'react';
import styles from './chatvi'


const ChatView = () => {


    return(
        <div className={styles.__container}>
                <div className={styles.__chat_div}>
                    <textarea name="chat" id="chat" cols="30" rows="10">
                        <p>hola mundo</p>
                    </textarea>
                </div>
        </div>
    )
}
export default ChatView;
